function demoFromHTML() {
		 var imgData = 'data:image/jpeg;base64,';
         var doc = new jsPDF('p', 'pt', 'letter');
         var specialElementHandlers = {
             '#bypassme': function(element, renderer) {
                 return true;
             }
         };
         doc.addImage(imgData, 'JPEG', 0, 40, 600, 200);
         doc.text(15, 260, "Summary of Orders");
         doc.fromHTML(
            $('#testcase').get(0), // [Refer Exact code tutorial][2]HTML string or DOM elem ref.
             10, // x coord
             300,    // y coord
             {
                 'width': 170, // max width of content on PDF
                 'elementHandlers': specialElementHandlers
             });

         doc.save('Review-of-orders.pdf');
         //doc.output('dataurl');
    }
    console.log("ready!");